import Head from 'next/head';
import Navbar from './Navbar';

const MasterPage = props => (
    <React.Fragment>
        <Head>
            <title>Bitcoins App</title>
        </Head>
        {props.children}
    </React.Fragment>
)

export default MasterPage;
